import { React, useEffect } from "react";
import axios from "axios";

const Details = ({ id }) => {
  useEffect(() => {
    const fetchDetails = () => {
      axios
        .get(
          "http://JavaReesbyapi-env.eba-rtdeyeqd.ap-southeast-2.elasticbeanstalk.com/api/v1/getallnotes/tenant/" +
            tenantId +
            "/module/" +
            moduleId
        )
        .then((response) => {
          const notesArr = response.data.slice();
          setNotes(notesArr);
        })
        .catch((error) => {
          console.log("Error fetching notes..");
          console.log(error);
        });
    };
    fetchDetails();
  });
  return <div></div>;
};

export default Details;
